1. It uses the `clipboard` crate to get the contents of the clipboard.
2. It creates a request to the ElevenLabs API using the `reqwest` crate, passing in the clipboard contents, voice, speed, and pitch as JSON data.
3. It sends the request and checks if the response was successful.
4. If the response was successful, it extracts the audio URL from the response JSON and uses the `mpg321` command to play the audio.

You'll need to replace `YOUR_ELEVENLABS_API_KEY` with your actual ElevenLabs API key.

You'll also need to add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.10"
serde_json = "1.0.64"
clipboard = "0.5.0"
```
